import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";

import Navbar from "./student-navbar.component";
import StudentLogin from "./student-login.component";
import CreateStudentAccount from "./student-create-account.component";

function Student() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>
        <Route path="/login" component = {StudentLogin} />
        <Route path="/create" component = {CreateStudentAccount} />
      </div>
    </Router>
  );
}

export default Student;
